    return (
      <div className='cart-item'>

        <div className="i-photo"><img src={this.props.images[0]} alt="" /></div>

        <p className="i-name">Pastel Pink T-shirt</p>
        <p className="i-number">01</p>
        <p className="i-number">$86</p>
        <span className='i-btn' onClick={this.removeProducts}>CHECK OUT</span>
      </div>
    )
  }
}

